import { TextField } from "@mui/material";
import Logo from "./logo";

function Signup() {
  return (
    <div className="flex min-h-screen justify-center items-center">
      <div className="flex flex-col border border-1 mt-2 h-signup-h w-signup-w">
        <div className="px-4 py-4">
          {" "}
          <Logo />
        </div>
        <div className="px-8 py-2">
          {" "}
          <p className="font-roboto text-4xl text-gray-900 text-left ">
            Sign up
          </p>
        </div>
        <div>
          {" "}
          <form className="flex flex-col">
            <TextField
              label="Username"
              margin="normal"
              variant="outlined"
              //   value={email}
              //   onChange={handEmailChange}
              fullWidth
            ></TextField>
            <TextField
              label="Email"
              margin="normal"
              variant="outlined"
              //   value={email}
              //   onChange={handEmailChange}
              fullWidth
            ></TextField>
            <TextField
              label="Password"
              margin="normal"
              variant="outlined"
              //   value={email}
              //   onChange={handEmailChange}
              fullWidth
            ></TextField>
            <input
              type="text"
              className="border"
              placeholder="Username"
            ></input>
            <input type="email" className="border" placeholder="Email"></input>
            <input
              type="password"
              className="border"
              placeholder="Password username"
            ></input>
          </form>
        </div>
      </div>
    </div>
  );
}
export default Signup;
